import DropDown from './components/sitesdropdownlist'
import { Button, ButtonDropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';

class Sites extends Component {

    state = { theme: null, dropdownOpen: false, sites: "" }




    render() {
        return (
            <div className="d-flex flex-wrap justify-content-center position-absolute w-30 h-30 align-items-center align-content-center">
                <DropDown className="navbar-dark" fluid>
                </DropDown>
            </div>
        );

    }

}

export default Sites;
